    const [plateNumber,setPlateNumber] = useState();

  return (

   <form>
    <h1>Enter your details here</h1>
    <input type="text" onChange={(e) => {setName(e.target.value)}} placeholder='Full name'/><br />
    <input type="text" placeholder='Identification number'/><br />
    <input type="text" placeholder='Address'/><br />
    <input type="text" placeholder='Mobile/Phone number'/><br />
    <input type="text" placeholder='Plate number'/><br />
